# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - django.http.response.HttpResponseBadRequest~Subclass
    - libthumbor
    - Member[django].Member[views].Member[HttpResponseBadRequest]
  - - django.http.response.HttpResponseNotAllowed~Subclass
    - libthumbor
    - Member[django].Member[views].Member[HttpResponseNotAllowed]
  - - django.http.response.HttpResponse~Subclass
    - libthumbor
    - Member[django].Member[views].Member[HttpResponse]
